export default function WorkBar(props) {
    const colors = ['white', 'red', 'green', 'blue', 'black'];
    
    const colorsBtns = colors.map(data => (<button onClick={() => props.setCurrentColor(data)}>{data}</button>))

    return (
        <div>
            <p>{props.currentColor}</p>
            <div style={{backgroundColor: `${props.currentColor}`, width:'100px', height:'100px', borderColor:"black", borderWidth:'1px'}}>currentColor</div> 
            {colorsBtns}
        </div>
    )
}
